from typing import List


class Solution:
    def maxProfit(self, prices: List[int]) -> int:
        # A function to slide the begining of the list if 
        # there're only descending values
        def slide_descendant_at_start(prices: List[int]) -> List[int]:
            # Start a cycle to check every value from the start
            for i in range(len(prices)-1):
                # Check if next value is lower than the current
                # one
                if prices[i] < prices[i+1]:
                    # Return the list strating from the current
                    # value
                    return prices[i:]
            
            # Return an empty list    
            return []
        
        # A function to slide the eending of the list if 
        # there're only ascending values
        def slide_ascendant_at_end(prices: List[int]) -> List[int]:
            # Start a cycle to check every value from the end
            for i in range(len(prices)-1, 0, -1):
                # Check if next value is greater than the 
                # current one
                if prices[i] > prices[i-1]:
                    # Return the list ending to the current
                    # value
                    return prices[:i+1]
            
            # Return an empty list     
            return []
        
        # Default profit
        max_profit = 0
        
        # Start an endless cycle
        while True:
            # Slide the list
            prices = slide_descendant_at_start(prices)
            
            # Check if the length of the list is not less than 1
            if len(prices) <= 1:
                # Break the cycle
                break
            
            # Slide the list
            prices = slide_ascendant_at_end(prices)
            
            # Check if the length of the list is not less than 1
            if len(prices) <= 1:
                # Break the cycle
                break
            
            # Find an index of minimal value            
            min_index = prices.index(min(prices))
            
            # Check if mininmal value is at the one before the
            # last position
            if min_index == len(prices) - 1:
                # Check if the length of the list is not less 
                # than 1
                if len(prices) <= 1:
                    # Break the cycle
                    break
                
                # Slide 2 last values from the list    
                prices = prices[:len(prices)-1]
                # Continue the cycle
                continue
            
            # Find the max value starting from the index of a
            # minimal value    
            max_value = max(prices[min_index:])
            # Find the index of the maximal value starting from
            # the index of a minimal value
            max_index = prices.index(max_value, min_index)
            # Define the profit
            this_profit = prices[max_index] - prices[min_index]
            
            # Check if this profit is higher than the 
            # previously defined    
            if this_profit > max_profit:
                # Strore new profit
                max_profit = this_profit
            
            # Check if the index of a minimal value is not at
            # the start of the list and the index of a maximal
            # value is not at the end of the list    
            if min_index > 0 and max_index < len(prices)-1:
                # Get the same list, but exlcuding the range
                # from the minimal index to maximal one
                prices = prices[:min_index] + prices[max_index+1:]
            
            # Check if the index of a minimal value is not at
            # the start of the list and the index of a maximal
            # value is at the end of the list           
            elif min_index > 0 and max_index == len(prices)-1:
                # Get the same list, but exlcuding the range
                # from the minimal index
                prices = prices[:min_index]
            
            # Check if the index of a minimal value is at
            # the start of the list and the index of a maximal
            # value is not at the end of the list                
            elif min_index == 0 and max_index < len(prices)-1:
                # Get the same list, but exlcuding the range
                # from the maximal index
                prices = prices[max_index+1:]
                    
            else:
                break
        
        # Return profit    
        return max_profit

