class Solution:
    def maxProfit(self, prices: List[int]) -> int:
        # Check if the list is not empty
        if not prices:
            return 0
        
        # Set default value for the minimal price to ensure 
        # that any price will be lower
        min_price = float('inf')
        # Set default value for the profit
        max_profit = 0
        
        # Check every price
        for price in prices:
            # Check if this price is lower than the minimal one
            if price < min_price:
                # Set new minimal price
                min_price = price
            # Check if difference between this price and the 
            # minimal one is greater than the maximal profit
            elif price - min_price > max_profit:
                # Set new maximal profit
                max_profit = price - min_price
        
        # Return profit
        return max_profit
    
